'''Eclectic implings''' are [[impling]]s that can be caught in the [[Impetuous Impulses]] [[Minigames|minigame]], and are located throughout [[Puro-Puro]] and [[Gielinor]]. The player needs at least 50 [[Hunter]] to capture this type of impling with a [[butterfly net]] or [[magic butterfly net]], or at least 60 [[Hunter]] to capture it barehanded. Capturing an eclectic impling grants 30 Hunter experience (if caught on Puro-Puro) or 32 Hunter experience (if caught elsewhere in Gielinor). They are popularly hunted by players due to their 1/25 chance of giving a [[Clue scroll (medium)|medium clue scroll]] when looted.

When captured, the player can loot the [[eclectic impling jar]], leaving an item behind, or can trade it with [[Elnock Inquisitor]]. The player can trade one eclectic impling for 3 [[impling jar]]s, or can trade 3 [[essence impling]]s, 2 eclectic impings and one [[nature impling]] for a [[jar generator]].

Often, people will "camp" an eclectic impling spawn point in Puro-Puro, looting and keeping the stackable drops, until they get a clue scroll. One of the best respawn points is the north-west corner of Puro-Puro, as there is a better chance for the impling to be trapped against the wall so it can't run away.


